package leetcode.algorithms;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

/**
 * Description: 859. Buddy Strings
 *
 * @author Baltan
 * @date 2018/8/10 23:05
 */
public class BuddyStrings {
    public static void main(String[] args) {
        System.out.println(buddyStrings("ab", "ba"));
        System.out.println(buddyStrings("ab", "ab"));
        System.out.println(buddyStrings("aa", "aa"));
        System.out.println(buddyStrings("aaaaaaabc", "aaaaaaacb"));
        System.out.println(buddyStrings("", "aa"));
        System.out.println(buddyStrings(
                "",
                ""));
    }

    public static boolean buddyStrings(String A, String B) {
        if (A == null || B == null || A.length() != B.length() || A.length() == 1) {
            return false;
        }

        char[] aArray = A.toCharArray();
        char[] bArray = B.toCharArray();
        List<Integer> diffIndexList = new ArrayList<>();

        for (int i = 0; i < aArray.length; i++) {
            if (aArray[i] != bArray[i]) {
                diffIndexList.add(i);
            }
        }
        if (diffIndexList.size() > 2 || diffIndexList.size() == 1) {
            return false;
        } else if (diffIndexList.size() == 2 && aArray[diffIndexList.get(0)] == bArray[diffIndexList.get(1)]
                && aArray[diffIndexList.get(1)] == bArray[diffIndexList.get(0)]) {
            return true;
        } else {
            Arrays.sort(aArray);
            for (int i = 1; i < aArray.length; i++) {
                if (aArray[i] == aArray[i - 1]) {
                    return true;
                }
            }
        }
        return false;
    }
}
